INNER JOIN Grafana.UC04_Results ON Grafana.UC04_Account_Details.Account_ID=Grafana.UC04_Results.Account_Sender
WHERE Grafana.UC04_Account_Details.Account_ID IN ($Filter_Sender) AND Grafana.UC04_Results.Account_Receiver IN ($Filter_Receiver);

